    false,nt"url": null,nt"notes": "USGS Task Order No. G10PD00236 USGS Contract
    No. G10PC00093 The Light Detection and Ranging (LiDAR) dataset is a survey of the
    Suwannee River Expansion in north-central Florida. The entire survey area encompasses
    950 square miles. The LiDAR point cloud was flown at a nominal post spacing of 1.0
    meters for unobscured areas. The LiDAR data and derivative products produced are
    in compliance with the U.S. Geological Survey National Geospatial Program Guidelines
    and Base Specifications, Version 13-ILMF 2010. The flight lines were acquired by
    Digital Aerial Solutions. This data set is divided into 4 Areas: A, B, C, and D.
    Area A: Portions of Dixie, Levy, and Gilchrist Counties Area B: Portions of Lafayette,
    Suwannee, and Madison Counties Area C: Suwannee County Area D: Bradford and Union
    Counties A map of each Area can be found in the Task Order Detail listed below.
    This data set is classified according to ASPRS LAS V1.2 standards. The classifications
    for this data set are as follows: Class 1: Unclassified Class 2: Ground Class 7:
    Noise Class 9: Water Class 10: Ignored Ground (Breakline Proximity) Class 12: Overlap
